const Navbar = () => {
    return ( 
        <table border={2}>
            <tr>
                <th>Goa </th>
                <th>Mountain </th>
                <th>Beaches </th>
                <th>Birds </th>
                <th>Foods </th>
            </tr>
        </table>
        
     );
}
 
export default Navbar;
